    - ID: "30b0a514-dc94-432c-9655-8c01e474023f"
      Hint: ExtendedContent
      Value: "<p>Kaytee Forti-Diet Pro Health Egg-Cite! Parakeet food was developed by an avian nutritionist to provide the nutrition bird owners have come to expect from Forti-Diet Pro Health Egg-Cite! is a seed and grain based diet which contains Omega 3's, Probiotics and Prebiotics plus farm fresh egg crumbles. Egg crumbles provide a source of high quality protein, vitamins, minerals and essential amino acids. Kaytee Forti-Diet Pro Health Egg-Cite! is especially beneficial during breeding and molting by providing that extra protein birds need.<br><br>Kaytee understands that sharing your life with a pet bird is not only enjoyable but very enriching. Kaytee shows our love by ensuring we provide your pet bird with the best nutrition for a long and healthy life. With over 150 years of nutritional experience, it's no wonder why Kaytee is at the heart of every healthy feeding routine.</p>"
